func must(err error) {
	if err != nil {
		log.Fatal().Err(err).Msg("failed")
	}
}

func json(v any) string {
	var sb strings.Builder
	e := stdjson.NewEncoder(&sb)
	e.SetIndent("", "  ")
	must(e.Encode(v))
	return sb.String()
}

func time(s string) stdtime.Time {
	t, err := stdtime.Parse(stdtime.RFC3339, s)
	must(err)
	return t
}

